import './App.css';
import './components/Gallery';
import { Gallery } from './components/Gallery';
import { 
  BrowserRouter,
  Routes,
  Route
 } from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
            <Route path ="/" element={Gallery}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
